import "./App.css";
import { useState } from "react";

function App() {
  const [nombre, setNombre] = useState("");
  const [edad, setEdad] = useState(0);
  const [pais, setPais] = useState("");
  const [cargo, setCargo] = useState("");
  const [anios, setAnios] = useState(0);

  const mostrarDatos = () => {
    alert(nombre);
  }
  return (
    <div className="App">
      <div className="datos">
        <label>
          Nombre(s):{" "}
          <input
            onChange={(event) => {
              setNombre(event.target.value);
            }}
            type="text"
          />
        </label>
        <label>
          Apellido Paterno:{" "}
          <input
            onChange={(event) => {
              setNombre(event.target.value);
            }}
            type="text"
          />
        </label>
        <label>
          Apellido Materno:{" "}
          <input
            onChange={(event) => {
              setNombre(event.target.value);
            }}
            type="text"
          />
        </label>
        <label>
          Edad:{" "}
          <input
            onChange={(event) => {
              setEdad(event.target.value);
            }}
            type="number"
          />
        </label>
        <label>
          Calle:{" "}
          <input
            onChange={(event) => {
              setPais(event.target.value);
            }}
            type="text"
          />
        </label>
        <label>
          Colonia:{" "}
          <input
            onChange={(event) => {
              setPais(event.target.value);
            }}
            type="text"
          />
        </label>
        <label>
          Código Postal:{" "}
          <input
            onChange={(event) => {
              setPais(event.target.value);
            }}
            type="text"
          />
        </label>
        <label>
          Cargo:{" "}
          <input
            onChange={(event) => {
              setCargo(event.target.value);
            }}
            type="text"
          />
        </label>
        <label>
          Años:{" "}
          <input
            onChange={(event) => {
              setAnios(event.target.value);
            }}
            type="number"
          />
        </label>
        <button onClick={mostrarDatos}>Registrar</button>
      </div>
    </div>
  );
}

export default App;
